import React from 'react';
import { StyleSheet } from 'react-native';


const styles = StyleSheet.create ({
    button: {
        width: 200,
        borderRadius: 8,
        paddingVertical: 14,
        paddingHorizontal: 10,
        
    },

    buttonText: {
        color: 'white',
        fontWeight: 'bold',
        textTransform: 'uppercase',
        fontSize: 16,
        textAlign: 'center',
    }
})

export default styles;
